import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { userAPI } from '../services/api';
import PropertyCard from '../components/PropertyCard';
import './UserDashboard.css';

const UserDashboard = () => {
    const [user, setUser] = useState(null);
    const [favorites, setFavorites] = useState([]);
    const [listedProperties, setListedProperties] = useState([]);
    const [loading, setLoading] = useState(true);
    const navigate = useNavigate();

    useEffect(() => {
        fetchDashboardData();
    }, []);

    const fetchDashboardData = async () => {
        try {
            const storedUser = JSON.parse(localStorage.getItem('user'));
            if (!storedUser || !storedUser.id) {
                navigate('/login');
                return;
            }

            const response = await userAPI.getDashboard(storedUser.id);
            const { user, favorites, listedProperties } = response.data.data;
            setUser(user);
            setFavorites(favorites);
            setListedProperties(listedProperties);
        } catch (error) {
            console.error('Error fetching dashboard data:', error);
        } finally {
            setLoading(false);
        }
    };

    if (loading) return (
        <div className="loading-container">
            <div className="spinner"></div>
        </div>
    );

    if (!user) return null;

    return (
        <div className="user-dashboard">
            <div className="dashboard-container">
                <div className="profile-section">
                    <div className="profile-header">
                        <div className="profile-avatar">
                            {user.name.charAt(0).toUpperCase()}
                        </div>
                        <div className="profile-info">
                            <h1>{user.name}</h1>
                            <p className="profile-email">{user.email}</p>
                            <div className="profile-details">
                                <span>üìç {user.address || 'No address provided'}</span>
                                <span>üìû {user.phone || 'No phone provided'}</span>
                            </div>
                        </div>
                    </div>
                </div>

                <div className="dashboard-content">
                    <section className="dashboard-section">
                        <div className="section-header">
                            <h2>My Favorites ‚ù§Ô∏è</h2>
                            <span className="count-badge">{favorites.length}</span>
                        </div>
                        {favorites.length > 0 ? (
                            <div className="properties-grid">
                                {favorites.map(property => (
                                    <PropertyCard key={property._id} property={property} />
                                ))}
                            </div>
                        ) : (
                            <div className="empty-state">
                                <p>No favorite properties yet. Start exploring!</p>
                                <button onClick={() => navigate('/')} className="btn-explore">Explore Properties</button>
                            </div>
                        )}
                    </section>

                    <section className="dashboard-section">
                        <div className="section-header">
                            <h2>My Listings üè†</h2>
                            <span className="count-badge">{listedProperties.length}</span>
                        </div>
                        {listedProperties.length > 0 ? (
                            <div className="properties-grid">
                                {listedProperties.map(property => (
                                    <PropertyCard key={property._id} property={property} />
                                ))}
                            </div>
                        ) : (
                            <div className="empty-state">
                                <p>You haven't listed any properties for sale.</p>
                                <button onClick={() => navigate('/sell')} className="btn-explore">List a Property</button>
                            </div>
                        )}
                    </section>
                </div>
            </div>
        </div>
    );
};

export default UserDashboard;
